"""
Some of the Files don't have some of the keys (meta, thumbPath, extension) so I needed
to handle the KeyError exceptions so that the loop could pass to the next item.
"""

for tag in tags:
    
    # Checking if "meta" is in the tag dict
    if "meta" in tag:
        tag.pop('meta')
    
    if "thumbPath" in tag:
        tag.pop('thumbPath')
    
    if "extension" in tag:
        tag.pop('extension')

